import { BrowserRouter as Router, Route } from 'react-router-dom';
import './App.css';
import SideBar from './components/navbar';
import ContactPage from './pages/contact';

function App() {
  return (
    <Router> 
      <div className="App">
        <h1>hola</h1>
        <div>
          <Route path="/contact" component={ContactPage} />
        </div>
        <SideBar />
      </div>
    </Router>
  );
}

export default App;
